import { Col, Container, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import SearchBar from "./SearchBar";
import "./App.css";

function App() {
  return (
    <Container fluid>
      <Row>
        <SearchBar />
      </Row>
      <Row className="border border-dark">
        <h1>Button</h1>
      </Row>
    </Container>
  );
}

export default App;
